import axios from "axios"
import React from 'react'
import Comments from './Comments'

const Posts = (props) => {

    return (
        <div>
            <div className="posts">
                {
                    props.blogposts.map((blogpost) => (
                        <div key={blogpost.id}>
                            <p>{blogpost.content}</p>
                        </div>
                    ))
                }
            </div>
        </div>
    )
}

export default Posts
